from collections import defaultdict

i, k = 0, 17
test_data = open("shared_kmer.txt", "r")
data = test_data.read()

text1 = data[0]
text2 = data[1]

# text1 = "AAACTCATC"
# text2 = "TTTCAAATC"

length = len(text1)

list_of_list1 = defaultdict(set)
list_of_list2 = defaultdict(set)
list1 = []

while i in range(0, length-k+1):
    pattern = text1[i:i + k]
    list1.append(pattern)
    i += 1

list2 = []
i = 0
indices = defaultdict(list)
while i in range(0, length-k+1):
    pattern = text2[i:i + k]
    list2.append(pattern)
    i += 1

#print(" ".join(list_of_list2.get(max(list_of_list2.keys()))))  #AT CG


DNA = {'A': 'T', 'C': 'G', 'G': 'C', 'T': 'A'}

elems_in_both_lists1 = set(list1) & set(list2)

for x in elems_in_both_lists1:
    print(x, text1.index(x), text2.index(x))

list3 = []
i = 0
dna = defaultdict(list)

for x in list1:
    x1 = x[::-1]
    for ch in x1:
        dna[i].append(ch)
    i += 1

for x in dna.values():
    list3.append(''.join(DNA[ch] for ch in x))

elems_in_both_lists2 = set(list2) & set(list3)
print(elems_in_both_lists2.union(elems_in_both_lists1))

for x in elems_in_both_lists2:
    print(text1.index(''.join(DNA[ch] for ch in x[::-1])), text2.index(x))

